import React, { useEffect, useState } from "react";
import { useAuth } from "../context/AuthContext";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import { useForm } from "react-hook-form";

const API = "http://localhost:3001";

export default function UploadMaterial() {
  const { user } = useAuth();
  const navigate = useNavigate();
  const {
    register,
    handleSubmit,
    reset,
    formState: { errors },
  } = useForm();
  const [materials, setMaterials] = useState([]);

  useEffect(() => {
    if (!user || user.role !== "teacher") {
      navigate("/login");
    } else {
      fetchMaterials();
    }
  }, [user, navigate]);

  const fetchMaterials = async () =>
    setMaterials((await axios.get(`${API}/materials`)).data);

  const onSubmit = async (data) => {
    const newMaterial = { ...data, id: Date.now() };
    await axios.post(`${API}/materials`, newMaterial);
    setMaterials((prev) => [...prev, newMaterial]);
    reset();
  };

  const handleDelete = async (id) => {
    if (!window.confirm("Xác nhận xoá?")) return;
    await axios.delete(`${API}/materials/${id}`);
    setMaterials((prev) => prev.filter((m) => m.id !== id));
  };

  return (
    <div className="max-w-3xl mx-auto p-6">
      <h2 className="text-2xl font-bold mb-4">Tải tài liệu lên</h2>
      <form
        onSubmit={handleSubmit(onSubmit)}
        className="bg-white p-4 rounded shadow space-y-4 mb-6"
      >
        <div>
          <input
            {...register("title", { required: "Tiêu đề không được để trống" })}
            placeholder="Tiêu đề"
            className="w-full border p-2 rounded"
          />
          {errors.title && (
            <p className="text-red-600">{errors.title.message}</p>
          )}
        </div>
        <div>
          <textarea
            {...register("description", {
              required: "Mô tả không được để trống",
            })}
            placeholder="Mô tả"
            className="w-full border p-2 rounded"
          />
          {errors.description && (
            <p className="text-red-600">{errors.description.message}</p>
          )}
        </div>
        <div>
          <input
            {...register("link", {
              required: "Link không được để trống",
              pattern: {
                value: /^https?:\/\//,
                message: "Link phải bắt đầu bằng http:// hoặc https://",
              },
            })}
            placeholder="Link (PDF, video...)"
            className="w-full border p-2 rounded"
          />
          {errors.link && <p className="text-red-600">{errors.link.message}</p>}
        </div>
        <button
          type="submit"
          className="bg-blue-600 text-white px-4 py-2 rounded"
        >
          Tải lên
        </button>
      </form>

      <h3 className="text-xl font-semibold mb-2">Danh sách tài liệu</h3>
      <ul className="space-y-4">
        {materials.map((doc) => (
          <li
            key={doc.id}
            className="bg-white p-4 rounded shadow flex justify-between items-start"
          >
            <div>
              <h4 className="font-semibold">{doc.title}</h4>
              <p className="text-gray-600">{doc.description}</p>
              <a
                href={doc.link}
                target="_blank"
                rel="noopener noreferrer"
                className="text-blue-600 hover:underline"
              >
                Xem tài liệu
              </a>
            </div>
            <button
              onClick={() => handleDelete(doc.id)}
              className="bg-red-500 text-white px-3 py-1 rounded self-start"
            >
              Xoá
            </button>
          </li>
        ))}
      </ul>
    </div>
  );
}
